import React from 'react';
import { useTranslation } from "react-i18next";

function Footer (){
    const { i18n } = useTranslation();

    return (
      <div className="footer">
            <img src="images/logo-white.svg" className="footer-logo" alt="" />

            <form className="footer-form-newsletter" onSubmit="">
                <div className="footer-form-newsletter-text text"> JOIN OUR NEWSLETTER </div>
                <div className="footer-form-newsletter-area">
                <input type="email" className="footer-form-newsletter-input text-detail" placeholder="Email"/>
                <button type="submit" className="footer-form-newsletter-button text-note"> SEND </button>
                </div>
            </form>
      </div>
  );
};

export default Footer;
